import './sass/main.scss';
import OutlinedCard from './Fetch';


function App() {

    let card = OutlinedCard();
    return ( < div className = "image" > <
        section className = " features" >
        <
        div className = "feature__grid" >
        <
        img alt = "logo"
        src = "https://lh3.googleusercontent.com/8OGH33WXpY1zvuoDskZ2WviJi_TukEz5H-LPAYV22CWmxLVD4VGpn9fjJ4OYvFYJMOc9NiIag5ENwSKgWQIEE1-mxtSs3ybY_-sasTxqJuQgeCilFz259tKdguEAAXuFXNMJfMDCYAjvMErD1RmUiB2sIEoApoUbu0cfjY8KwYS7WA3RXX7WkSn5dsJTnUH15J3ObZM-qWsJW9cbRbkTRjjX4aONLo_zjgSHqnGwrO01fXNVK9OpuMRYeTUUdBGwSKADypBFQs_VpImAbM3uePLc2LJRpI7Bll-9x1-tmI2SSKNZ3vN5G4DyoDkjghMNEzPq0yR3wUFP-fHfNJpqq-ZlwI6IEwgQcej86Zw0Yr9IHtu8qAbt5sxhlk_hhOM-l2GreKXu4aE0fzQdL3ggbE6jHq9B2MgSdlgnxlDoVC_ajLbCLpUuMZdUYnKxZkL8MAkYkyX2gcko6V8OVb23FHD3_-9XcBHaZGlWhOJZcidjGMYt-YkepYoZveKNelvTnBGn7DzEf1_Pe5nww-sWEph_2G9NwPfkHJQlv_vHgL8ElQLb3fxKYjsnc7xXrE4se_nP4NVbyO6_pXk3N0C0f2kgDp6-bFFNotsf0ty2cWeoQtr5k1CfeERRkI1n_V61O-FDtSFajcBBGPzAFYAf__X282c9pVlYPFEADn0zyiltKDx_Ov4N-0eMLxQ4OY8=s958-no?authuser=0" / >
        <
        h3 className = "banner"
        id = "react1" >
        Good Morning < /
        h3 > < /
        div >

        <
        /
        section >
        <
        code className = "banner"
        id = "react1" >
        Frontend Developer Intern Challenge < /
        code > < p > < /p> <
        button className = "newpage"
        onClick = {
            () => {
                var v = document.getElementById("id");
                v.style.display = "block";
                if (v.style.display === "none") {
                    v.style.display = "block";
                } else {
                    v.style.display = "none";
                }
            }
        } > click here <
        /button> {card} < /
        div >
    );
}

export default App;
